an cause serious problems with \r\nyour internet connection.</p>\r\n  </li><li style="text-align: left;">\r\n    <p><strong>Make sure you are connected directly to the internet and not through a proxy</strong>:\r\n Proxy servers can cause problems with large file uploads. Some may have\r\n limits on the size of the file that can be uploaded, and others just \r\nhandle uploads very poorly.</p>\r\n  </li><li style="text-align: left;">\r\n    <p><strong>Make sure the file you are trying to upload is located on a local hard drive and not on a network, USB or FireWire drive</strong>:\r\n Sometimes the extra latency or an intermittent connection can cause \r\nissues when uploading files that are not located directly on the hard \r\ndrive of the computer from which you are uploading.</p>\r\n  </li><li style="text-align: left;">\r\n    <p><strong>Make sure your computer does not go to sleep while you are uploading</strong>: If your computer goes to sleep while an upload is in progress, it will almost certainly cause the upload to fail.</p>\r\n  </li><li style="text-align: left;">\r\n    <p><strong>If you are connected to the internet via WiFi make sure \r\nyou have a strong and stable connection or switch to using an ethernet \r\ncable if possible</strong>:  Weak or intermittent internet connections \r\ndue to spotty WiFi can sometimes cause uploads to fail. Make sure you \r\nhave a strong connection to your WiFi network or use an ethernet cable \r\nif possible.</p>\r\n  </li><li style="text-align: left;">\r\n    <p><strong>Make sure your video file has completely finished exporting</strong>:\r\n If you just clicked export from your video editing software, your video\r\n file will appear in your selected folder, however, it might not be \r\nfinished processing. Be sure the editing program is no longer running \r\nany processes on the file, and that you can open the finished video and \r\nplay it on your computer. An incomplete file will definitely cause an \r\nupload to fail.</p>\r\n  </li><li>\r\n    <p style="text-align: left;"><strong>Try using a different web browser</strong>: Some browsers are better able to upload large files than others.</p>\r\n  </li></ul></center>\r\n  <br><center><span style="font-size: 20px;font-family: &quot;Segoe UI&quot;, sans-serif;">Live, Share ...Make the Difference!</span>\r\n  </center><label></label></center>	2020-06-25 09:56:27.035961-04	2021-03-15 06:40:50.794519-04	your_skigit_video_not_uploaded	1	1	Your Skigit Failed to Upload	
